    [],nt"num_tags": 5,nt"name": "san-joaquin-river-national-wildlife-refuge-final-comprehensive-conservation-plan",nt"isopen":
    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on San Joaquin River NWR for the next 15 years.
    This plan outlines the Refuge vision and purpose and describes how San Joaquin River
    NWR will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP process, information about
    the environment, opportunities and problems, goals and objectives, and strategies
    for implementation. Key planning issues include: water quantity and quality, water
    rights, riparian restoration, grassland communities, invasive weeds, and threatened
    and endangered species.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
